/**
 * @main
 * Listing all commands in cmd handler as defines with filepaths to the cmds.
 * This file is automaticly generated by CMDS_LIST_HANDLER.
 * It contains #define's with filepaths for all commands in CMDS_HANDLER.
 * CMDS_HANDLER tells the CMDS_LIST_HANDLER to update on every change.
 *
 * If you need a pointer to a 'cmd', include this file and use the define.
 * That way things update themselves at changes.
 *
 * For redundancy and stability the critical commands always has a define.
 * If a command disappears, and your included then used define disappears
 * we're in troubble.  At least the errors handler catch it.
 * All critical defines for rebooting the mud is listed for legacy.
 *
 * @author Silbago
 */

